// Data members
// Database connection
private Connection con = null;
private Statement st;

public boolean connect()
{
  boolean isConnected = false;
  try
  {
    Class.forName("com.mysql.jdbc.Driver");
    con=DriverManager.getConnection(
    "jdbc:mysql://localhost/test?user=abacus&password=eli");
    if(con!=null)
    {
      st = con.createStatement();
      isConnected = true;
    }
  }
  catch(Exception e)
  {
    e.printStackTrace();
  }
  return isConnected;
}

public void writeToText(String lineRec)
{
  try
  {
    BufferedWriter out = new BufferedWriter(new FileWriter(
    "\\customer.txt", true));
    out.write(lineRec);
    out.close();  }
  catch(Exception e)
  {
    e.printStackTrace();
  }
}
// This function clears all the text fields
// on the JFrame
public void clearItems()
{
  String sRecord="\"" + JTextField1.getText() + "\"" + "," + "\""
  + JTextField2.getText() +
  "\"" + "," + "\"" + JTextField3.getText() + "\"" +
  "," + "\"" + JTextField4.getText() +  "\"" + "," + "\""
  + JTextField5.getText() + "\"";
  System.out.println(sRecord);

  if(JCheckBox1.isSelected()==false)
  {
    writeToText(sRecord);
  }
  else
  {
    saveToDatabase(sRecord);
  }
  String defaultClear = "";
  JTextField1.setText(defaultClear);
  JTextField2.setText(defaultClear);
  JTextField3.setText(defaultClear);
  JTextField4.setText(defaultClear);
  JTextField5.setText(defaultClear);
}

public void saveToDatabase(String sLineRecord)
{
  if(st==null)
  connect();
  if(st!=null)
  {
    try
    {
      String insertCmd =
      "INSERT INTO customer(COLUMN_1, COLUMN_2 ,COLUMN_3,COLUMN_4,COLUMN_5) VALUES("
      + sLineRecord + ")" ;
      st.executeUpdate(insertCmd );
    }
    catch(Exception e)
    {
      e.printStackTrace();
    }
  }
}

